import React from "react";
import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles({
    footer: {
        background: "black",
        color: "white"
    }
});

export default () => {

    const classes = useStyles();

    return (
        <div className={classes.footer}>
            <span>Hello</span>
        </div>
    )
}
